0410\u043d\u0434\u0435\u0440\u0441\u043e\u043d\">\u0414\u0436\u0443\u0431\u0430\u043b \u042d\u0440\u043b\u0438<\/a> \u043f\u043e\u0431\u0435\u0434\u0438\u043b \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0423\u043e\u043b\u043b\u0435\u0441\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1877_%D0%B3%D0%BE%D0%B4\" title=\"1877 \u0433\u043e\u0434\">1877<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B8%D0%BC%D0%B1%D0%BB%D0%B4%D0%BE%D0%BD\" title=\"\u0423\u0438\u043c\u0431\u043b\u0434\u043e\u043d\">\u0423\u0438\u043c\u0431\u043b\u0434\u043e\u043d\u0435<\/a> \u0441\u0442\u0430\u0440\u0442\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043f\u043e \u0442\u0435\u043d\u043d\u0438\u0441\u0443, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u043e\u0432\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1_%D0%BB%D0%B0%D1%83%D0%BD-%D1%82%D0%B5%D0%BD%D0%BD%D0%B8%D1%81%D0%B0_%D0%B8_%D0%BA%D1%80%D0%BE%D0%BA%D0%B5%D1%82%D0%B0\" title=\"\u0412\u0441\u0435\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u043b\u0443\u0431 \u043b\u0430\u0443\u043d-\u0442\u0435\u043d\u043d\u0438\u0441\u0430 \u0438 \u043a\u0440\u043e\u043a\u0435\u0442\u0430\">\u0412\u0441\u0435\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u043b\u0443\u0431 \u043b\u0430\u0443\u043d-\u0442\u0435\u043d\u043d\u0438\u0441\u0430 \u0438 \u043a\u0440\u043e\u043a\u0435\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1886_%D0%B3%D0%BE%D0%B4\" title=\"1886 \u0433\u043e\u0434\">1886<\/a>&#160;\u2014 \u0425\u0443\u043d\u0447\u0443\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0432 \u0443\u0440\u043e\u0447\u0438\u0449\u0435 \u041d\u043e\u0432\u043e-\u041a\u0438\u0435\u0432\u0441\u043a\u043e\u043c \u043e\u0431 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0438 \u0433\u0440\u0430\u043d\u0438\u0446\u044b \u043c\u0435\u0436\u0434\u0443 \u0420\u043e\u0441\u0441\u0438\u0435\u0439 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0438\u0442\u0430\u0435\u043c<\/a> \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u043e\u0437\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%81%D0%B0%D0%BD_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)\" title=\"\u0425\u0430\u0441\u0430\u043d (\u043e\u0437\u0435\u0440\u043e)\">\u0425\u0430\u0441\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u0430\u0431\u0440\u0438\u043a\u0430\u043d\u0442 \u0431\u0443\u043c\u0430\u0433\u0438 \u0414\u0436\u043e\u043d \u0414\u0438\u043a\u0438\u043d\u0441\u043e\u043d (John Dickinson) \u043d\u0430 \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e\u0439 \u0432\u0441\u0442\u0440\u0435\u0447\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0435\u0439 \u0431\u0443\u043c\u0430\u0433\u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b \u043d\u0430 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u043e\u0431\u0435\u0434\u0435 \u043f\u0435\u0440\u0432\u044b\u0435 \u0431\u0443\u043c\u0430\u0436\u043d\u044b\u0435 \u0441\u0430\u043b\u0444\u0435\u0442\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%8F_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B0_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0412\u0438\u043a\u0442\u043e\u0440\u0438\u044f (\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438)\">\u0412\u0438\u043a\u0442\u043e\u0440\u0438\u044f<\/a> \u0434\u0430\u043b\u0430 \u0441\u0432\u043e\u0451 \u043e\u0434\u043e\u0431\u0440\u0435\u043d\u0438\u0435 \u0417\u0430\u043a\u043e\u043d\u0443 \u043e\u0431 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0438 \u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438, \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u043e \u043d\u043e\u0432\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438 (\u0441 1 \u044f\u043d\u0432\u0430\u0440\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439\">\u0438\u043c\u043f\u0435