f\u0435\u0440\u0430\u0446\u0438\u0438 \u0425\u0430\u0441\u043a\u0438<\/a> (\u0432\u044b\u0441\u0430\u0434\u043a\u0430 \u0441\u043e\u044e\u0437\u043d\u044b\u0445 \u0432\u043e\u0439\u0441\u043a \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%86%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0421\u0438\u0446\u0438\u043b\u0438\u044f\">\u0421\u0438\u0446\u0438\u043b\u0438\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5_%D0%93%D0%BE%D0%BB%D0%BB%D1%8C,_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C\" title=\"\u0414\u0435 \u0413\u043e\u043b\u043b\u044c, \u0428\u0430\u0440\u043b\u044c\">\u0428\u0430\u0440\u043b\u044c \u0434\u0435 \u0413\u043e\u043b\u043b\u044c<\/a> \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u043f\u0440\u043e\u0432\u0435\u0441\u0442\u0438 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c \u0434\u043b\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430 \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1952_%D0%B3%D0%BE%D0%B4\" title=\"1952 \u0433\u043e\u0434\">1952<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0414\u0435\u043c\u043e