8\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%83%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%B8%D0%B4%D1%80%D0%BE%D1%83%D0%B7%D0%B5%D0%BB\" title=\"\u0410\u0441\u0443\u0430\u043d\u0441\u043a\u0438\u0439 \u0433\u0438\u0434\u0440\u043e\u0443\u0437\u0435\u043b\">\u0410\u0441\u0443\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0442\u0438\u043d\u044b<\/a>, \u043f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0435\u0442<\/a> \u043e\u0431\u0440\u0430\u0442\u0438\u043b\u0441\u044f \u0437\u0430 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 102-\u0439 \u044d\u043b\u0435\u043c\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B8%D0%BE%D0%B4%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%8D%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82%D0%BE%D0%B2\" title=\"\u041f\u0435\u0440\u0438\u043e\u0434\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432\">\u0442\u0430\u0431\u043b\u0438\u0446\u044b \u041c\u0435\u043d\u0434\u0435\u043b\u0435\u0435\u0432\u0430<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B8%D0%B9\" title=\"\u041d\u043e\u0431\u0435\u043b\u0438\u0439\">\u043d\u043e\u0431\u0435\u043b\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%BE%D0%BB%D0%B7%D0%B5%D0%BD%D1%8C\" title=\"\u041e\u043f\u043e\u043b\u0437\u0435\u043d\u044c\">\u043e\u043f\u043e\u043b\u0437\u0435\u043d\u044c<\/a> \u0432\u044b\u0437\u0432\u0430\u043b \u0432\u043e\u043b\u043d\u0443 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u043e\u0439 \u0432\u044b\u0441\u043e\u0442\u044b (574 \u043c), \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0441\u043e \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c\u044e 160 \u043a\u043c\/\u0447 \u043f\u0440\u043e\u043a\u0430\u0442\u0438\u043b\u0430\u0441\u044c \u043f\u043e \u0443\u0437\u043a\u043e\u043c\u0443, \u043f\u043e\u0445\u043e\u0436\u0435\u043c\u0443 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%8C%D0%BE%D1%80%D0%B4\" title=\"\u0424\u044c\u043e\u0440\u0434\">\u0444\u044c\u043e\u0440\u0434<\/a> \u0437\u0430\u043b\u0438\u0432\u0443 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9B%D0%B8%D1%82%D1%83%D1%8F&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041b\u0438\u0442\u0443\u044f (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041b\u0438\u0442\u0443\u044f<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0\" title=\"\u0410\u043b\u044f\u0441\u043a\u0430\">\u0410\u043b\u044f\u0441\u043a\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u044f\">\u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0438<\/a> \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D1%83%D0%B0%D0%BD%D0%B4%D0%B0_%D0%9A%D0%B0%D1%80%D1%82%D0%B0%D0%B2%D0%B8%D0%B4%D0%B6%D0%B0%D0%B9%D1%8F\" title=\"\u0414\u0436\u0443\u0430\u043d\u0434\u0430 \u041a\u0430\u0440\u0442\u0430\u0432\u0438\u0434\u0436\u0430\u0439\u044f\">\u0420\u0430\u0434\u0435\u043d\u043e\u043c \u0414\u0436\u0443\u0430\u043d\u0434\u043e\u0439 \u041a\u0430\u0440\u0442\u0430\u0432\u0438\u0434\u0436\u0430\u0439\u044f<\/a> \u0432\u044b\u0448\u043b\u043e \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443, \u043d\u043e\u0432\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043b \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BA%D0%B0%D1%80%D0%BD%D0%BE\" title=\"\u0421\u0443\u043a\u0430\u0440\u043d\u043e\">\u0421\u0443\u043a\u0430\u0440\u043d\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%BD%D0%B8%D0%BF%D0%B5%D0%B3\" title=\"\u0412\u0438\u043d\u043d\u0438\u043f\u0435\u0433\">\u0412\u0438\u043d\u043d\u0438\u043f\u0435\u0433\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4