\u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u0447\u043b\u0435\u043d\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>, \u0438\u0441\u043a\u043b\u044e\u0447\u0451\u043d\u043d\u043e\u0439 \u0440\u0430\u043d\u0435\u0435 \u0437\u0430 \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u0443\u044e \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%B0%D1%80%D1%82%D0%B5%D0%B8%D0%B4\" title=\"\u0410\u043f\u0430\u0440\u0442\u0435\u0438\u0434\">\u0430\u043f\u0430\u0440\u0442\u0435\u0438\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442 \u0417\u0430\u043a\u043e\u043d \u0420\u0424 \u00ab\u041e\u0431 \u0430\u0432\u0442\u043e\u0440\u0441\u043a\u043e\u043c \u043f\u0440\u0430\u0432\u0435 \u0438 \u0441\u043c\u0435\u0436\u043d\u044b\u0445 \u043f\u0440\u0430\u0432\u0430\u0445\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BA%D0%B0%D0%B3%D0%BE\" title=\"\u0427\u0438\u043a\u0430\u0433\u043e\">\u0427\u0438\u043a\u0430\u0433\u043e<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043a\u043e\u043d\u0446\u0435\u0440\u0442 \u0433\u0440\u0443\u043f\u043f\u044b \u00abThe Grateful Dead\u00bb. \u0412 \u0430\u0432\u0433\u0443\u0441\u0442\u0435 \u0443\u043c\u0435\u0440 \u043b\u0438\u0434\u0435\u0440 \u0433\u0440\u0443\u043f\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%80%D1%81%D0%B8%D1%8F,_%D0%94%D0%B6%D0%B5%D1%80%D1%80%D0%B8\" title=\"\u0413\u0430\u0440\u0441\u0438\u044f, \u0414\u0436\u0435\u0440\u0440\u0438\">\u0414\u0436\u0435\u0440\u0440\u0438 \u0413\u0430\u0440\u0441\u0438\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u0430<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0430 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%90%D0%A2%D0%9E\" title=\"\u041d\u0410\u0422\u041e\">\u041d\u0410\u0422\u041e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a><ul><li>\u0411\u0435\u0441\u043f\u0440\u0435\u0446\u0435\u0434\u0435\u043d\u0442\u043d\u0430\u044f \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u0448\u0438\u0431\u043a\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043d\u0435\u0431\u0440\u0435\u0436\u043d\u043e\u0441\u0442\u0438 \u0432\u0440\u0430\u0447\u0435\u0439 \u0443 \u0431\u0435\u043b\u043e\u0439 \u043f\u0430\u0440\u044b \u0432 \u043a\u043b\u0438\u043d\u0438\u043a\u0435 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043e\u043f\u043b\u043e\u0434\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u044f \u0440\u043e\u0434\u0438\u043b\u0430\u0441\u044c \u0442\u0435\u043c\u043d\u043e\u043a\u043e\u0436\u0430\u044f \u0434\u0432\u043e\u0439\u043d\u044f. \u0420\u043e\u0434\u0438\u0442\u0435\u043b\u0438 \u0441\u0447\u0438\u0442\u0430\u044e\u0442, \u0447\u0442\u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u0438 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u0438 \u043f\u0435\u0440\u0435\u043f\u0443\u0442\u0430\u043b\u0438 \u043f\u0440\u043e\u0431\u0438\u0440\u043a\u0438.<\/li><li>\u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B7%D0%BF%D1%80%D0%BE%D0%BC-%D0%9C%D0%B5%D0%B4%D0%B8%D0%B0_%D0%A5%D0%BE%D0%BB%D0%B4%D0%B8%D0%BD%D0%B3\" class=\"mw-redirect\" title=\"\u0413\u0430\u0437\u043f\u0440\u043e\u043c-\u041c\u0435\u0434\u0438\u0430 \u0425\u043e\u043b\u0434\u0438\u043d\u0433\">\u0413\u0430\u0437\u043f\u0440\u043e\u043c-\u043c\u0435\u0434\u0438\u0430<\/a>\u00bb \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u0438\u0438 \u0434\u043e\u043b\u0435\u0439 \u0438 \u0434\u043e\u043b\u0433\u043e\u0432\u044b\u0445 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D1%81%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0443\u0441\u0438\u043d\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430 \u0413\u0443\u0441\u0438\u043d\u0441\u043a\u043e\u0433\u043e<\/a> \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\u0445, \u0432\u0445\u043e\u0434\u044f\u0449\u0438\u0445 \u0432 \u044d\u0442\u043e\u0442 \u043c\u0435\u0434\u0438\u0430\u0445\u043e\u043b\u0434\u0438\u043d\u0433.<\/li><li>\u0412 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u043c \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435\u043c \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u043d\u0430 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0435 \u043c\u0438\u0440\u0430 \u043f\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002 \u0433\u043e\u0434\u0430<\/a> \u0432\u043b\u0430\u0441\u0442\u0438 \u042e\u0436\u043d\u043e\u0439 \u041a\u043e\u0440\u0435\u0438 \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u00ab\u043f\u0440\u043e\u0441\u0442\u0438\u0442\u044c\u00bb 4,8&#160;\u043c\u043b\u043d \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0434\u043e\u043f\u0443\u0441\u0442\u0438\u043b\u0438 \u043d\u0435\u0441\u0435\u0440\u044c\u0435\u0437\u043d\u044b\u0435 \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B8%D0%BB%D0%B0_%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u041f\u0440\u0430\u0432\u0438\u043b\u0430 \u0434\u043e\u0440\u043e\u0436\u043d\u043e\u0433\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f\">\u041f\u0414\u0414<\/a>.<\/li><li>\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u0430 (\u041e\u0410\u0415), \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u044e\u0449\u0430\u044f 53 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0410\u0444\u0440\u0438\u043a\u0438, \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_A310_%D0%B2_%D0%98%D1%80%D0%BA%D1%83%D1%82%D1%81%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 A310 \u0432 \u0418\u0440\u043a\u0443\u0442\u0441\u043a\u0435\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Airbus A310 \u043f\u043e\u0434 \u0418\u0440\u043a\u0443\u0442\u0441\u043a\u043e\u043c<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 125 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u042e\u0436\u043d\u044b\u0439 \u0421\u0443\u0434\u0430\u043d\">\u042e\u0436\u043d\u044b\u0439 \u0421\u0443\u0434\u0430\u043d<\/a> \u0441\u0442\u0430\u043b \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u044b\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c \u0441\u043e \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u0432 \u0414\u0436\u0443\u0431\u0435 .<\/li><\/ul><h2>"